Entry.Value:
int gr=20;

/// <summary>
        /// Initialisierung
        /// </summary>
        public override void Init() {
            base.Init();
            // Hier kann z.B. pow oder gr aus den Einstellungen gelesen werden.
        }


        public override long InSet(double ar, double ai, double aj, double br, double bi, double bj, double bk, long zkl, bool invers) {


            double aar, aai, ai_alt, aj_alt, aaj, aak, cj, ck, ari, arj, ark, aik, aij, ajk, ak_alt;
            double c, d;
            long tw;
            int n;

            aar = ar * ar; aai = ai * ai; aaj = aj * aj; tw = 0L;
            d = aar + aai + aaj;
            for (n = 1; n < zkl; n++) {

// = d
// r = x*x+y*y+z*z;
// sqrt(d)
//   r1 = sqrt(r);
double r1=Math.Sqrt(d);
 
double   phi   = ( zkl*8.0 )*Math.Asin(aj/r1);
double   theta = ( zkl*8.0 )*Math.Atan2(aj,ai);

   r1 = Math.Pow(d,4.0);
   ar = r1*Math.Cos(theta)*Math.Cos(phi);
   ai = r1*Math.Sin(theta)*Math.Cos(phi);
   aj = -r1*Math.Sin(phi);

  // x = x1+a;y=y1+b;z=z1+c;

/*
                ai = 2 * ai * ar * aj + bi;
                aj = aaj - (aai + aar) / 2.0 +  bj;
                ar = aar - (aai + aaj) / 2.0 + br;
*/

ai+=bi;
aj+=bj;
ar+=br;

                aar = ar * ar; aai = ai * ai; aaj = aj * aj;
                d = aar + aai + aaj;
                if ((d) > gr) { tw = n; break; }
            }
            return (tw);

        }
